import * as React from 'react';
import '../index.css';


class Home extends React.PureComponent {




    componentDidMount() {
        this.ensureDataFetched();
    }



   componentDidUpdate() {
        this.ensureDataFetched();
    }

    ensureDataFetched() {
        const currentBlogPost = parseInt(this.props.match.params.currentBlogPost, 10) || 0;
        this.props.requestBlogPosts(currentBlogPost);
    }

    render() {
        return (
            <div>
                <h1>Hello, world!</h1>
                <p>Welcome to my site. There is not much you can do here atm but, it's going to look amazing in a little while.</p>
            </div>
        )
    };
};

export default Home;
